import React from 'react';
import '../../Body.css';
import Header from '../../../Components/Header/Header';
import Footer from '../../../Components/Footer/Footer';

export default function AddPublisher (){

    return(

        <div>

            <Header />

            <div className='body add-publisher'>

                <div className='add-publisher-content'>
                    <p>Add new genre</p>

                    <input className='add--inputs' type="text" placeholder='Title' />
                        
                    <div className='add-genre-buttons-container edit-buttons'>
                        <button className='add-genre-buttons'>Edit</button>
                        <button className='add-genre-buttons'>Save Changes</button>
                        <button className='add-genre-buttons'>Add</button>
                    </div>

                </div>

            </div>

            <Footer />

        </div>

    )

}
